text:
3. Sinh viên được xếp trình độ năm học căn cứ số tín chỉ tích lũy được từ

đầu khóa học (gọi tắt là N) và số tín chỉ trung bình một năm học theo kế hoạch

học tập chuẩn là 38 tín chỉ, cụ thể như sau:

a) Trình độ năm thứ nhất: N < 38;

b) Trình độ năm thứ hai: 38 ≤ N < 76;

c) Trình độ năm thứ ba: 76 ≤ N < 114;

d) Trình độ năm thứ tư: 114 ≤ N.
